import React from 'react';
import { useParams } from 'react-router-dom';

export const PropertyDetail = () => {
  const { id } = useParams();

  const propertyDetails = {
    1: { 
      title: 'Olivia Court', 
      location: 'Lekki, Lagos', 
      introduction: 'Olivia Court is a premium residential property located in the heart of Lekki. It offers a modern living experience with a blend of luxury and comfort.', 
      description: 'Meticulously crafted to embrace open-plan living, blending functionality with style. Enjoy uninterrupted power, fully fitted kitchens, and a luxurious fitness center.',
      image: '/img/ff6.jpg',
      logo: '/img/intro-bg.png' 
    },
    2: { 
      title: 'Property 2', 
      location: 'Victoria Island, Lagos', 
      introduction: 'This luxurious property offers a sophisticated living environment in Victoria Island.', 
      description: 'Luxury features such as a swimming pool, state-of-the-art fitness center, and handcrafted furniture.',
      image: '/img/ff1.webp',
      logo: '/img/intro-bg.png'
    },
    3: { 
      title: 'Property 3', 
      location: 'Ikoyi, Lagos', 
      introduction: 'A prestigious residential property in Ikoyi.', 
      description: 'Luxury living with custom furnishings and access to all major amenities.',
      image: '/img/ff2.webp',
      logo: '/img/intro-bg.png'
    },
    4: { 
      title: 'Property 4', 
      location: 'Banana Island, Lagos', 
      introduction: 'A luxurious property offering stunning views and high-end facilities in Banana Island.', 
      description: 'Premium features include an infinity pool, private gym, and bespoke interior design.',
      image: '/img/ff3.jpg',
      logo: '/img/intro-bg.png'
    },
    5: { 
      title: 'Property 5', 
      location: 'Eko Atlantic, Lagos', 
      introduction: 'A cutting-edge property with state-of-the-art amenities in Eko Atlantic.', 
      description: 'Offering cutting-edge technology, open-concept living spaces, and an exclusive rooftop lounge.',
      image: '/img/ff4.jpg',
      logo: '/img/intro-bg.png'
    },
    6: { 
      title: 'Property 6', 
      location: 'Lekki Phase 1, Lagos', 
      introduction: 'A modern development designed for contemporary living in Lekki Phase 1.', 
      description: 'Includes high-speed internet, a co-working space, and an ultra-modern gym.',
      image: '/img/ff6jpg',
      logo: '/img/intro-bg.png'
    }
  };

  const property = propertyDetails[id];

  if (!property) {
    return <div>Property not found.</div>;
  }

  return (
    <div className="property-detail-container">
      <div className="main-content">
        <div className="media-section">
          {/* Replace iframe with an image */}
          <img
            src={property.image}
            alt={property.title}
            className="property-image"
            style={{ width: '100%', height: 'auto' }} 
          />
        </div>
        <div className="details-section">
          <h1>{property.title}</h1>
          <h2>{property.location}</h2>
          <div className="property-introduction">
            <h3>Introducing {property.title}</h3>
            <p>{property.introduction}</p>
          </div>
          <p>{property.description}</p>
          <ul className="features-list">
            <li>Luxury Living Rooms</li>
            <li>Quality Hand-Made Furniture</li>
            <li>Fully Fitted Kitchen</li>
            <li>Uninterrupted Power Supply</li>
            <li>Swimming Pool</li>
            <li>Fitness Center and Lounge</li>
          </ul>
          <button className="read-brochure-btn">Read Project Brochure</button>
        </div>
      </div>
      <div className="logo-section">
        <img src={property.logo} alt="Company Logo" className="company-logo" />
      </div>
    </div>
  );
};

export default PropertyDetail;
